import React from 'react';
import { connect } from 'react-redux';
import {
  FetchSingleData,
  GetAllImages,
  GetImage,
  SetActiveIdentifier,
} from '../../Redux/Actions/actions.js';

class MediaFilesList extends React.PureComponent {
  render() {
    if (this.props.responseDataList !== '') {
      var elements = [];
      var element;
      var test;
      var header = (
        <>
          <thead>
            <tr>
              <th>Mediafile</th>
            </tr>
          </thead>
          <button
            onClick={() => {
              test = this.props.getImage(1);
            }}
          >
            GetImage
          </button>
          <p>----------</p>
          <button
            onClick={() => {
              test = this.props.getImage(1);
            }}
          >
            GetAllImages
          </button>
          <img src={this.props.singleResponseData} alt="НИПАЛУЧИЛАСЬ" />
        </>
      );

      var arr = [];
      for (let i = 0; i < this.props.responseDataList.length; i++) {
        arr = arr.concat(this.props.responseDataList[i]);
      }

      for (let i = 0; i < this.props.responseDataList.length; i++) {
        element = '';
        element = (
          <tr className="dataTable">
            {this.props.responseDataList[i].contentType}
          </tr>
        );
        elements = elements.concat(element);
      }
    }

    if (this.props.responseDataList !== '') {
      return (
        <>
          <div className="dataTable">
            <table className="tableStyle">
              {header}
              <tbody>{elements}</tbody>
            </table>
          </div>
        </>
      );
    }
  }
}

function mapStateToProps(state) {
  return {
    responseDataList: state.responseDataList,
    singleResponseData: state.singleResponseData,
    activeId: state.activeId,
    activeMenu: state.activeMenu,
  };
}

function mapDispatchToProps(dispatch) {
  return {
    getImage: (id) => dispatch(GetImage(id)),
    setActiveId: (id) => dispatch(SetActiveIdentifier(id)),
    getAllImages: () => dispatch(GetAllImages()),
  };
}

export default connect(mapStateToProps, mapDispatchToProps)(MediaFilesList);
